import { lazy } from 'react'

const MasterMeetingsRoutes = [
  {
    path: '/master-of-meeting/create-meeting',
    component: lazy(() => import('../../views/pages/mom/MOM'))
  },
  {
    path: '/master-of-meeting/list-meeting',
    component: lazy(() => import('../../views/pages/mom/ListOfMeeting'))
  },
  {
    path: '/master_of_meeting/googlemap',
    component: lazy(() => import('../../views/pages/mom/GoogleMap'))
  }
]

export default MasterMeetingsRoutes
